import React, { useEffect, useState } from "react";

const Paginate = () => {
  return (
    <>
      <div>
        <button
          onClick={() => {
            if (state.page > 1) {
              changePage(state.page - 1);
            }
          }}
        >
          Prev
        </button>
        ...
        <button
          onClick={() => {
            changePage(1);
          }}
        >
          1
        </button>
        <button
          onClick={() => {
            changePage(2);
          }}
        >
          2
        </button>
        ...
        <button
          onClick={() => {
            if (todos.length >= 1 && todos.length != 0) {
              changePage(state.page + 1);
            }
          }}
        >
          Next
        </button>
      </div>
    </>
  );
};

export default Paginate;
